# Парсим HTML
soup = BeautifulSoup(html, 'html.parser')

# Готовим CSV файл
with open('kanji_n4_data.csv', 'w', newline='', encoding='utf-8') as csvfile:
    writer = csv.writer(csvfile, delimiter=';')
    writer.writerow(['kanji', 'onyomi', 'kunyomi', 'meaning'])

    for row in soup.select('tr.charRow'):
        kanji = row.select_one('td.character .characterElem').text.strip()
        meaning = row.select_one('td.meaning').text.strip()

        readings = row.select('td.reading .readingElem')
        onyomi = readings[0].text.strip().replace('\n', '') if len(readings) > 0 else ''

        # Убираем <span class="okurigana">...</span> из kunyomi
        kunyomi = ''
        if len(readings) > 1:
            kunyomi_elem = readings[1]
            for span in kunyomi_elem.select('span.okurigana'):
                span.decompose()
            kunyomi = kunyomi_elem.text.strip()

        writer.writerow([kanji, onyomi, kunyomi, meaning])

print("CSV файл 'kanji_n4_data.csv' успешно создан.")